import React, { useState } from "react";

const Homepage = (props) => {
    const [toggle, setToggle] = useState(true);
    console.log(toggle)
    setInterval(() => toggle ? setToggle(false) : setToggle(true), 2000);
    setInterval(() => {
        console.log(toggle)
    }, 2000);
}

export default Homepage;
